        "sirdataPurpose6.description": {
            "en": "The use of latitude and longitude obtained through GPS location allows for the delivery of ads tailored to your location at a given moment. For example, you might receive a promotion from a store when you are nearby. This approach targets users based on their geographical position, ensuring more relevant content delivery and enhancing the effectiveness of your advertising campaigns.",
            "fr": "L'utilisation de la latitude et de la longitude obtenues grâce à la localisation par module GPS permet de diffuser des publicités adaptées à votre emplacement à un moment donné. Par exemple, vous pourriez recevoir une promotion d'un magasin lorsque vous vous trouvez à proximité. Cette approche cible les utilisateurs en fonction de leur position géographique, assurant une diffusion de contenu plus pertinente et améliorant l'efficacité de vos campagnes publicitaires."
        },
