            "fr": "Vous pouvez accepter ou refuser que les données collectées ici soient combinées avec celles déjà détenues par nos partenaires pour vous envoyer des offres personnalisées par courrier postal, email, fax, SMS/MMS et téléphone. Cela inclut des identifiants, des données sociodémographiques, géographiques et comportementales, ainsi que vos coordonnées postales, votre adresse électronique, vos numéros de fax et de téléphone. Ces traitements reposent généralement sur votre consentement, mais certains peuvent être basés sur des intérêts légitimes, auxquels cas vous pouvez les refuser. Cela concerne par exemple certains transferts de données ou si la prospection se fait dans le cadre de votre activité professionnelle. Cliquez ci-dessous pour plus d'informations."
